import React from 'react'
import {Form , Input} from 'antd';

function AdminIntro() {
  return (
    <div>

      <Form>
        <Form.Item>
          <Input placeholder='Intro' />
        </Form.Item>
      </Form>

    </div>
  )
}

export default AdminIntro
